var title_f1_36_1612="Changing practice behavior";
var content_f1_36_1612=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F58403&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F58403&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Options for changing clinicians' practice behavior*",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Education",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Passive: Providing information by CME, journals, books, electronic media",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Active: Provide answers to questions as they arise (\"just-in-time learning\")",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Change the work environment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Make it easier to do the right thing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Case managers",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Feedback on performance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Practice pattern reports for physician's use only",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Public report cards: HEDIS and others",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Clinical Practice Guidelines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Authoritative, recommendations, tailored to local situation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Should include an evidence-based rationale",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Local opinion leaders",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Informal, disease-specific network of respected colleagues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Persuasion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        \"Academic detailing\" methods similar to advertisements",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Economic incentives/disincentives",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Capitation, risk contracts",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Tying compensation to performance",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Change patients' expectations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Popular media, books, patient help hotlines",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Direct-to-patient marketing",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * In descending order of strength.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
