var title_f1_36_1613="Drug therapy for treatment of histoplasmosis infections in HIV";
var content_f1_36_1613=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F82973&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F82973&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Drug therapy for treatment and chronic maintenance therapy of AIDS-associated histoplasma capsulatum infections in adults and adolescents",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Preferred therapy, duration of therapy, chronic maintenance",
"       </td>",
"       <td class=\"subtitle1\">",
"        Alternative therapy",
"       </td>",
"       <td class=\"subtitle1\">",
"        Other options/issues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <p>",
"         <strong>",
"          Preferred therapy for moderately severe to severe disseminated disease",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          Induction therapy",
"         </em>",
"         (for 2 weeks or until clinically improved)",
"        </p>",
"        <ul>",
"         <li>",
"          Liposomal amphotericin B at 3 mg/kg IV daily",
"         </li>",
"        </ul>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         <em>",
"          Maintenance therapy",
"         </em>",
"        </p>",
"        <ul>",
"         <li>",
"          Itraconazole 200 mg PO tid for 3 days, then bid",
"         </li>",
"        </ul>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         <strong>",
"          Preferred therapy for less severe disseminated disease",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          Induction and maintenance therapy",
"         </em>",
"        </p>",
"        <ul>",
"         <li>",
"          Itraconazole 200 mg PO tid for 3 days, then 200 mg PO bid",
"         </li>",
"        </ul>",
"        <p>",
"         Duration of therapy: at least 12 months",
"        </p>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         <strong>",
"          Preferred therapy for meningitis",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          Induction therapy",
"         </em>",
"         (4-6 weeks)",
"        </p>",
"        <ul>",
"         <li>",
"          Liposomal amphotericin B 5 mg/kg/day",
"         </li>",
"        </ul>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         <em>",
"          Maintenance therapy",
"         </em>",
"        </p>",
"        <ul>",
"         <li>",
"          Itraconazole 200 mg PO bid-tid for &ge;1 year and until resolution of abnormal CSF findings",
"         </li>",
"        </ul>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         <strong>",
"          Preferred therapy for long term suppression therapy",
"         </strong>",
"        </p>",
"        <p>",
"         In patients with severe disseminated or CNS infection and in patients who relapse despite appropriate therapy (CIII)",
"        </p>",
"        <ul>",
"         <li>",
"          Itraconazole 200 mg PO daily",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Alternative therapy moderately severe to severe disseminated disease",
"         </strong>",
"        </p>",
"        <p>",
"         <em>",
"          Induction therapy",
"         </em>",
"         (for 2 weeks or until clinically improved)",
"        </p>",
"        <ul>",
"         <li>",
"          Amphotericin B deoxycholate 0.7 mg/kg IV daily",
"         </li>",
"         <li>",
"          Amphotericin B lipid complex 5 mg/kg IV daily",
"         </li>",
"        </ul>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         <em>",
"          Maintenance therapy",
"         </em>",
"        </p>",
"        <p>",
"         Same as \"Preferred therapy\"",
"        </p>",
"       </td>",
"       <td>",
"        <p>",
"         Itraconazole levels should be obtained in all patients to ensure adequate absorption. Serum concentrations of itraconazole + hydroxyitraconazole should be &gt;1 mcg/mL.",
"        </p>",
"        <p>",
"         Itraconazole oral solution is preferred over capsule by certain specialists because of&nbsp;improved absorption",
"        </p>",
"        <p>",
"         Acute pulmonary histoplasmosis in HIV- infected patients with CD4+ count &gt;300 cells/microL should be managed as non-immunocompromised host",
"        </p>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Guidelines for Prevention and Treatment of Opportunistic Infections in HIV-Infected Adults and Adolescents. Recommendations from CDC, the National Institutes of Health, and the HIV Medicine Association of the Infectious Diseases Society of America. MMWR Morb Mortal Wkly Rep 2009; 58:1.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
